import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

//1. Get the notes array and loop round each item
//2. For each item return a new <Note /> DOM

function createNote(aNote){
    return <Note title={aNote.title} content={aNote.content} />
}

function App() {
    return (
        <div>
            <Header />
            {notes.map( createNote )}
            <Footer />
        </div>

    );
}

export default App;
